import React from 'react'
import { withTranslation } from 'react-i18next'
import { ChevronLeft } from 'react-feather'
import { Tooltip } from 'antd'
import './Share.less'

import chart from '@misc/images/chart.svg'
import clock from '@misc/images/clock.svg'
// import attendance from '../../../misc/images/attendance.svg'
// import blackboard from '../../../misc/images/blackboard.svg'
// import shareScreen from '../../../misc/images/monitor.svg'
// import shareFile from '../../../misc/images/upload.svg'
// import group from '../../../misc/images/group.svg'

import Attendance from './ShareComponents/Attendance'
import ListMenu from './ShareComponents/ListMenu'
import VoteMenu from './ShareComponents/VoteMenu'
import Timer from './ShareComponents/Timer'
import MultipleQuestion from './ShareComponents/MultipleQuestion'
import TrueFalseQuestion from './ShareComponents/TrueFalseQuestion'

class TabShare extends React.Component {
  // state = {
  //   title: 'Chia sẻ nội dung',
  //   component: '',
  //   back: null,
  //   data: [
  //     {
  //       name: 'Nội dung chính',
  //       list: [
  //         {
  //           icon: blackboard,
  //           text: 'Chia sẻ bảng trắng trống',
  //           link: 'blackboard',
  //           isMore: false
  //         },
  //         {
  //           icon: shareScreen,
  //           text: 'Chia sẻ ứng dụng/màn hình',
  //           link: 'shareScreen',
  //           isMore: false
  //         },
  //         {
  //           icon: shareFile,
  //           text: 'Chia sẻ tệp',
  //           link: 'shareFile',
  //           isMore: true
  //         }
  //       ]
  //     },
  //     {
  //       name: 'Nội dung phụ',
  //       list: [
  //         {
  //           icon: chart,
  //           text: 'Thăm dò ý kiến',
  //           link: 'vote',
  //           isMore: true
  //         },
  //         {
  //           icon: clock,
  //           text: 'Đồng hồ hẹn giờ',
  //           link: 'timer',
  //           isMore: true
  //         },
  //         {
  //           icon: attendance,
  //           text: 'Điểm danh',
  //           link: 'attendance',
  //           isMore: true
  //         }
  //       ]
  //     },
  //     {
  //       name: 'Tương tác',
  //       list: [
  //         {
  //           icon: group,
  //           text: 'Nhóm lớn',
  //           isMore: true
  //         }
  //       ]
  //     }
  //   ]
  // }

  state = {
    title: 'shareContent',
    component: '',
    back: null,
    data: [
      {
        name: 'additionalContent',
        list: [
          {
            icon: chart,
            text: 'poll',
            link: 'vote',
            isMore: true,
            code: 'VOTE_CREATE'
          },
          {
            icon: clock,
            text: 'timer',
            link: 'timer',
            isMore: true,
            code: 'TIMER_CREATE'
          }
          // {
          //   icon: attendance,
          //   text: 'attendance',
          //   link: 'attendance',
          //   isMore: true
          // }
        ]
      }
    ]
  }

  componentDidMount() {
    this.setState(_preState => ({
      component: (
        <ListMenu
          data={this.state.data}
          handleChoiceMenu={this.handleChoiceMenu}
        />
      )
    }))
  }

  handleChoiceMenu = value => {
    let title, component, back
    switch (value) {
      case 'vote': {
        title = 'poll'
        back = 'menu'
        component = <VoteMenu handleChoiceMenu={this.handleChoiceMenu} />
        break
      }
      case 'multipleQuestion': {
        title = 'poll'
        back = 'vote'
        component = <MultipleQuestion handleBack={this.handleBack} />
        break
      }
      case 'truefalseQuestion': {
        title = 'poll'
        back = 'vote'
        component = <TrueFalseQuestion handleBack={this.handleBack} />
        break
      }
      case 'timer': {
        title = 'timer'
        back = 'menu'
        component = <Timer handleBack={this.handleBack} />
        break
      }
      case 'attendance': {
        title = 'attendance'
        back = 'menu'
        component = <Attendance handleBack={this.handleBack} />
        break
      }
      default: {
        break
      }
    }

    this.setState(_preState => ({
      component,
      back,
      title
    }))
  }

  handleBack = value => {
    let title, component, back
    switch (value) {
      case 'menu': {
        title = 'shareContent'
        back = null
        component = (
          <ListMenu
            data={this.state.data}
            handleChoiceMenu={this.handleChoiceMenu}
          />
        )
        break
      }
      case 'vote': {
        title = 'poll'
        back = 'menu'
        component = <VoteMenu handleChoiceMenu={this.handleChoiceMenu} />
        break
      }
      default: {
        break
      }
    }

    this.setState(_preState => ({
      component,
      back,
      title
    }))
  }

  render() {
    const {
      state: { back, component, title },
      props: { i18n },
      handleBack
    } = this
    return (
      <div className='share'>
        <div className='share__head'>
          {back !== null ? (
            <Tooltip placement='bottomLeft' title='Previous Panel'>
              <button onClick={() => handleBack(back)}>
                <ChevronLeft size={20} />
              </button>
            </Tooltip>
          ) : null}
          <span>{i18n.t(title)}</span>
        </div>
        <div className='share__body'>{component}</div>
      </div>
    )
  }
}

export default withTranslation()(TabShare)
